import styled from 'styled-components'

export const InnerBoxContainer = styled.div`
  margin-top: 24px;
  margin-left: 36px;
  width: calc(100% - 72px);
  min-width: 884px;
  background: #ffffff;
  box-shadow: 0px 0px 24px rgba(0, 0, 0, 0.16);
  border-radius: 24px;
  flex: none;
  order: 1;
  flex-grow: 0;
`

export const InnerBoxHeader = styled.div`
  display: flex;
  min-width: 884px;
  justify-content: space-between;
  margin-left: 36px;
  margin-right: 36px;
  padding-top: 24px;
`

export const InnerBoxTitle = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 40px;
  color: #000000;
`
